import axios from "axios";

export const getMovies = async () => {
  const res = await axios.get("http://localhost:3001/movies");

  return res.data;
};

export const getMovie = async (id) => {
  console.log(id);
  const res = await axios.get(`http://localhost:3001/movies/{id}`);
  console.log(res);
  return res.data;
};
